import React from 'react'

export default class extends React.Component {
    render() {
        return (
            <div>
                <div className="container">
                    <img src=" /platzi-logo.png" alt="" />
                    <h1>Created by Zunirry</h1>
                    <p>A course with Next.js</p>

                </div>
                <style jsx >{`
                    :global(body) {
                    background: #1A2A35;
                    }
                    
                    h1{
                        color: #cccc;
                    }
                    p{
                        color: #cccc;
                    }

                    .container{
                        border: 2px solid red;
                        right: -20px;
                    }
                `}</style>

                
            </div>
        )
    }
}
